import React from "react";
import Navbar from "./Navbar";
import ContactForm from "./Contact";
import InfoCard from "./InfoCards";
import Footer from "./Footer";
import backImage from '../Assets/back_contact.png'
import Logo from '../Assets/logo.png'
const Home = () => {
    return (
        <div>
            <Navbar />
            <div className="min-h-[316px] w-full bg-cover bg-center relative" style={{ backgroundImage: `url(${backImage})` }}>

                <div className="min-h-[316px] flex justify-center items-center">
                    <div className="flex flex-col justify-center items-center ">
                        <div className="w-[77px] h-[77px] flex justify-center items-center">
                            <img src={Logo} alt="Logo" />
                        </div>
                        <h1 className="text-4xl poppins-regular font-medium text-[#000000]">Contact</h1>
                        <p className=" poppins-regular text-[#000000] flex gap-2 items-center">
                            <span className="text-[16px] text-[#000000] font-medium">Home</span>
                            <span className="text-[17px] text-[#000000] font-medium pt-1">{">"}</span>
                            <span className="text-[16px] text-[#000000] font-light">Contact</span> </p>
                    </div>
                </div>
            </div>



            <ContactForm />
            <InfoCard />
            <Footer />
        </div>
    );
}

export default Home;
